    MintServiceABI, '0x306a271F178aD37083cDA734F3Aca694FF301B0F'
  )

  const getSymbol = () => {
    mintService.methods.symbol().call().then(
      symbol => {
        console.log('Tokn Symbol: ', symbol);
    },err => { 
      console.log('err: ', err); 
    })
  }

  return(
    <>
      <button onClick={getSymbol}>CreateItems</button>
    </>
  )
}
